import { useContext } from 'react';
import { Route, Switch, Link } from 'react-router-dom';
import SearchBar from '../components/forms/searchBar.js';
import { CheckMood } from '../components/checkMood.js';


// search view:
//  results details view

export default function Search(){

    return(
        <div className='searchView-Container'>
            Find a friend
            <SearchBar/>
            <Link to={'/check_moods'}>
                <input className='bg-cyan-200 text-cyan-800 rounded p-1 m-2' type='button' value='check'/>
            </Link>
            <Switch>
                    <Route
                        path={`/check_moods`}
                        render={() => 
                            <CheckMood/>
                    }>
                    </Route>
            </Switch>
        </div>
    )
}
